import React from "react";
import Header from "./Header";
function Home() {
  return (
    <div>
      <div className="container-fluid  Home">
        <Header />
        <h1 className="text-center text-white display-3 mt-5">
          Welcome to GoPerformance
        </h1>
        <p className="lead"></p>
      </div>
    </div>
  );
}

export default Home;
